「地元愛」を忘れず地域密着を促進するためのレーベル「LOCAL FC」モデル。カジュアルシーンでも人気のチャンピオン社製アメリカンボディを採用したロゴプリントシャツ。<br><br>
品質：コットン100％<br>
モデル：2017年春夏<style type="text/css">

