 #lineup-osusume { margin-top:10px; padding:0 10px; }

 #lineup-osusume .osusume_t {
	border-radius:12px;background:#aacf53;color:#007b43;
	font-size:15px;
	padding:5px 10px;
	margin:20px 5px 0px 5px;
 }


#lineup-osusume span { 
	width:0px;
	height:0px;
	margin:0px 0px 10px 16px;
	border-style: solid;
	border-width: 10px 3px 0 12px;
	border-color: #aacf53 transparent transparent transparent;
	display:block;
	 }


#lineup-osusume ul{list-style:none;
margin:0 0 0 10;
padding:0;}

#lineup-osusume ul li {
	position:relative;
	width:50%;
	margin:0 auto;
	height:auto;
	margin-bottom:20px;
	overflow:hidden;
	float:left;
}

#lineup-osusume ul li:before {
	content:"";
	display:block;
	padding-top:140%;
}

#lineup-osusume ul li .box {
	position:absolute;
	top:0;
	left:0;
	width:100%;
	height:100%;
	color:#6f6f6f;
	padding:0 5px 0 5px;
	box-sizing:border-box;
	-webkit-box-sizing:border-box;
	-moz-box-sizing:border-box;
}
#lineup-osusume ul li .box a {
	display:block;
	width:100%;
	height:100%;
	position:absolute;
	top:0;
	left:0;
	text-indent:-99999px;}

#lineup-osusume ul li img { width:100%; }
#lineup-osusume ul li .box p { margin-top:5px; text-align:left; font-size:10px; }
#lineup-osusume ul li .box:hover p { color:#00ff66; }


